var Vector2=function(){function n(n,t){if(isNaN(n)||t!==!1)this.X=n||0,this.Y=t||0;else{var i=n*Math.PI/180;this.X=Math.cos(i),this.Y=Math.sin(i)}}return n.prototype.Length=function(){return Math.sqrt(Math.pow(this.X,2)+Math.pow(this.Y,2))},n.prototype.Abs=function(){return new n(Math.abs(this.X),Math.abs(this.Y))},n.prototype.DistanceTo=function(n){return Math.sqrt(Math.pow(n.X-this.X,2)+Math.pow(n.Y-this.Y,2))},n.prototype.ZeroOut=function(){this.X=0,this.Y=0},n.MultiplyV=function(t,i){return new n(t.X*i.X,t.Y*i.Y)},n.MultiplyN=function(t,i){return new n(t.X*i,t.Y*i)},n.AddV=function(t,i){return new n(t.X+i.X,t.Y+i.Y)},n.AddN=function(t,i){return new n(t.X+i,t.Y+i)},n.SubtractV=function(t,i){return new n(t.X-i.X,t.Y-i.Y)},n.SubtractVFromN=function(t,i){return new n(t.X-i,t.Y-i)},n.SubtractNFromV=function(t,i){return new n(t-i.X,t-i.Y)},n.DivideV=function(t,i){return new n(t.X/i.X,t.Y/i.Y)},n.DivideVByN=function(t,i){return new n(t.X/i,t.Y/i)},n.DivideNByV=function(t,i){return new n(t/i.X,t/i.Y)},n}()